vec3 calculateParametricCustomPolygon(vec3 normalVec, vec3 baseColor, vec3 fragWorldPos, vec4 lightPosData, vec4 lightColorData, vec4 lightParamData, vec4 extraPackedData, vec4 precomputedPoints[4],vec4 extraData2) {
