        float crossProduct = (b.x - a.x) * (checkLocalPos.y - a.y) - (b.y - a.y) * (checkLocalPos.x - a.x);
        if (a.y < b.y) {
          quickInside = quickInside != (crossProduct > 0.0);
        } else {
          quickInside = quickInside != (crossProduct < 0.0);
        }
      }
    }
    bool isRangeZero = (falloffRange<1.0);
