        attenuation = intensity;
    } else if (sdDist < falloffRange) {
        float normalizedDist = sdDist / falloffRange;
        float t= intPow10(1.0 - normalizedDist, falloffExponent);
        attenuation = intensity * clamp(t, 0.0, 1.0);
    } else {
        return vec3(0.0);
