}
 vec3 calculateSpriteLight(vec3 normalVec, vec3 baseColor, vec3 fragWorldPos, vec4 lightPosData, vec4 lightColorData, vec4 lightParamData,vec4 lightExtraData,vec4 lightExtraData2) {
    vec3 lightPos = lightPosData.xyz;
