    float cosA = lightExtraData.x;
    float sinA = lightExtraData.y;
    float rangeX = lightExtraData.z;
    float rangeY = lightExtraData.w;
    if (rangeX < 0.0001 || rangeY < 0.0001) return vec3(0.0);
    vec2 relativePos = fragWorldPos.xy - lightPos.xy;
    float maxRange = max(rangeX, rangeY);
    if (dot(relativePos, relativePos) > maxRange * maxRange ) return vec3(0.0);
    vec2 rel = vec2(
        dot(relativePos, vec2(cosA, -sinA)),
        dot(relativePos, vec2(sinA, cosA))
    );
    if(abs(rel.x) > rangeX*0.5 || abs(rel.y) > rangeY*0.5) return vec3(0.0);
    vec2 spriteUV = rel*vec2(1.0/rangeX,1.0/rangeY) + 0.5;
