    if (spriteTexColor.a < 0.001) return vec3(0.0);
    float attenuation = spriteTexColor.a;
    vec3 finalLight = spriteTexColor.rgb * lightColor * intensity * attenuation;
    vec3 lightDir;
    float lenSq = dot(rel, rel);
    if (lenSq > 0.0) {
        float invLen = inversesqrt(lenSq);
        lightDir = vec3(-rel * invLen, 0.0);
    } else {
        lightDir = vec3(0.0, 0.0, 1.0);
    }
    float diffuse = (length(normalVec - vec3(0.0, 0.0, 1.0)) < 0.001) ? 1.0 : max(0.0, dot(normalize(normalVec), lightDir));
    return baseColor * finalLight * diffuse;
}
