  float getShadowBit(vec4 shadowMask, float id) {
    int idx = int(id);
    int channel = idx / 8;
    int bit = idx - channel * 8;
    float v = 0.0;
    if (channel == 0) v = shadowMask.r;
    else if (channel == 1) v = shadowMask.g;
    else if (channel == 2) v = shadowMask.b;
    else if (channel == 3) v = shadowMask.a;
    float mask = 255.0 * v + 0.001;
    return mod(floor(mask / intPow10(2.0, float(bit))+ 0.001), 2.0);
  }
  float getNumberFromVec4Array(vec4 arr[16/4], int index) {
    int idx = index;
