    if (arrIdx == 0) v = arr[0];
    else if (arrIdx == 1) v = arr[1];
    else if (arrIdx == 2) v = arr[2];
    else if (arrIdx == 3) v = arr[3];
    if (compIdx == 0) return v.x;
    else if (compIdx == 1) return v.y;
    else if (compIdx == 2) return v.z;
    else return v.w;
  }
